import React,{useState} from "react";
import { Switch, FormGroup, FormControlLabel } from "@material-ui/core";
import Activity from '../Component/Charts/Gender'
import ApexCharts from '../Component/Charts/Activity'
import Age from '../Component/Charts/Age'
import Degree from '../Component/Charts/Degree'
import Departments from '../Component/ComponentCharts/Departments'
import Gender from '../Component/Component/Charts/Gender'
import Speciality from '../Component/Charts/Speciality'
import University from '../Component/Charts/University'

function Statistic() {
    const [Filter, setFilter] = useState([
        {
            check : true,
            department : 'Department'
        },
        {
            check : true,
            department : 'Activity'
        },
        {
            check : true,
            department : 'Age'
        },
        {
            check : true,
            department : 'University'
        },
        {
            check : true,
            department : 'Speciality'
        },
        {
            check : true,
            department : 'Degre'
        }

    ])
  return (
    <div id="statistic">
      <div id="statistic-block">
        <div className="container">
          <div id="statistik-flex" className="flex">
            <div id="statistic-left">
              <div id="sl-container">
                <h3>Filter</h3>
                <FormGroup>

                  <label className = 'flex'>
                    <h4>Yas</h4>
                    <FormControlLabel
                      control={
                        <Switch
                          size="small"
                        //   checked = {}
                        //   onChange = {}
                        />
                      }
                    />
                    </label>
                    {Filter.map(item => {
                        return(
                            <label className = 'flex'>
                            <h4>{item.department}</h4>
                            <FormControlLabel
                              control={
                                <Switch
                                  size="small"
                                //   checked = {}
                                //   onChange = {}
                                />
                              }
                            />
                            </label>
                        )
                    })}
                </FormGroup>
              </div>
            </div>
            <div id="statistic-right">
                <div id = 'sr-container'>
                    {/* {Filter.map(item => {
                        return(
                            <item.department />
                        )
                    })} */}
                    <Gender />
                </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Statistic;
